import React from "react";
import { Canvas } from "react-three-fiber";

const Model = () => {
  return (
    <div>
      <Canvas>
        <mesh>
          <boxBufferGeometry
            attach="geometry"
            args={[1, 1, 1]}
          ></boxBufferGeometry>
          <meshBasicMaterial
            attach="material"
            color="white"
          ></meshBasicMaterial>
        </mesh>
      </Canvas>
    </div>
  );
};

export default Model;
